double Simpson(float inf, float sup, double *fy, int n)
{
  long double res = fy[0];
  for(int i=1; i<n-1; i=i+2)
  {
    res+=4*fy[i];
    res+=2*fy[i+1];
  }
  res+=fy[n-1];
  return res*(sup-inf)/(3*n);
}


double Trapecio(float inf, float sup, double *fy, int n)
{
    double res=0;
    for(int i=0; i<n-1; i=i+2)
    {
        res+=fy[i];
        res+=2*fy[i+1];
    }
    res+=fy[n-1];
    return res * ((sup-inf)/(2*n));
}